O Campus de Castanhal necessita de melhorias urgentes: 
a) Um Restaurante Universitário; 
b) Um Laboratório de Informática para a Comunidade Discente; 
c) A Reforma do Auditório (está interditado); 
d) A Reforma do Ginásio (Cobertura, Vestiários, Tabelas de Basquetebol); 
e) A Reforma da Biblioteca (construção de salas individuais de estudo); 
f) A Reforma da Academia de Ginástica e da Sala de Lutas (correção das infiltrações); 
g) Contratação de um profissional de Psicologia para atendimento da Comunidade Discente; 
h) Contratação de um profissional de Educação Física para o gerenciamento dos espaços esportivos (ginásio, piscina, academia, sala de lutas, sala de dança, quadra de vôlei de areia, campo de futebol).

- Melhorar a comunicação interna e com a sociedade, pois a universidade faz muito coisa importante e a sociedade desconhece;
- As relações humanas ainda é um sério problema e merece uma atenção especial;
- As denuncias são feitas a ouvidoria, Comissão de ética e outras instancia, porém na ouvidoria vem uma reposta que fere princípios constitucionais e nada é feito. Nas demais instancias, o processo fica parado e nenhuma resposta é obtida, e quando obtida segue regimentos internos que não estão em consonância com a constituição. A certeza da impunidade está agravando as diferentes formas de violências nesta universidade. Os processos precisam ser avaliados e julgados de forma mais rápida e seguindo a hierarquia das leis (1o constituição e 2o leis federais),

- Investimentos na infraestrutura dos campi (salas de estudos para discentes da graduação e pós-graduação; laboratórios, espaços de convivência, espaços materno-infantis, auditórios, laboratórios de informática, gabinetes de docentes ou salas multiuso, salas especiais como as que atendem discentes com TEA - "Sala do Silêncio" ou "Sala de Descompressão");
- Inserção dos índices e metas referentes à ODS 5 "Alcançar a Igualdade de Gênero e Empoderar Todas as Mulheres e Meninas" nos PDUs e PDI;
- Apresentar dados com recorte de gênero, raça/cor e região/mesorregião no portal da UFPA - "UFPA em Números";
- Política de incentivo à participação de docentes nos programas de pós-graduação: garantia do registro da carga horária de aulas no PIT/SISPLAD (nos campi são preenchidas na graduação e a pós é algo a mais); se a pós-graduação é aumento do trabalho docente, que seja pago com uma bolsa para aquele que executa o trabalho (orientações e aulas);
- Tratamento dos servidores com igualdade de direitos: o programa saúde e qualidade de vida praticamente inexiste para os servidores dos 11 campi.
- Investimento no transporte para garantir as atividades práticas nos campi;
- Aumento do número de docentes com prioridade para as faculdades que se encontram com menos de 10 docentes;
- Distribuir de forma equitativa os cargos e gratificações entre servidores homens e mulheres na instituição.

Como docente lotado na Escola de Aplicação e que também atua no magistério superior, percebo:
1 - Uma desatualização nos cursos de graduação, temos conhecimento que alguns cursos ainda estudam os PCN's, nomenclatura não mais utilizada;
2 - A ufpa (incluo também da Escola de Aplicação) está localizada em bairros (Guamá e Terra Firme) de muitas construções irregulares e falta de saneamento e não percebemos intervenções efetivas nessas localidades;
3 - Quanto aos pcd's, é inegável que é possibilitado o ingresso deles, no entanto a permanência ainda é um grande entrave, na escola de Aplicação temos 3 casos de estudantes que precisaram ganhar na justiça para terem direito a profissionais de apoio escolar durante o tempo que estão na escola. Vale ressaltar que isso aconteceu com 3 estudantes, mas só no turno da tarde temos mais de 25 pcd's que estão desassistidos dessa possibilidade, claro que nem todos precisam dessa assistência mas aqui evidencia uma distinção de direitos usufruídos; 
4 - Na escola de Aplicação temos mais de 55 turmas de estudantes na educação básica, crianças e adolescentes, administração anterior resolveu colocar portas de vidro nas salas de aula, essas portas apresentam defeitos com muita frequência e de tempos em tempos elas quebram, somente no ano letivo de 2025 tivemos duas portas quebradas, no ano passado tivemos mais, em pelo menos dois casos tivemos terceirizado e aluno sendo ferido pelos estilhaços. A pergunta que se faz: Até quando teremos essas portas de vidro? Será necessário ocorrer algo mais grave para que a administração superior possa intervir na troca dessas portas? Vale ressaltar que a Escola de Aplicação não possui verba para a devida substituição.
5 - Abastecimento de água na Escola. Temos sérios problemas com o fornecimento de água por parte da Cosanpa. Não seria mais interessante para UFPA ter uma estação de tratamento de água e poço aqui na Escola? Faço essa pergunta pois perdemos dias letivos devido a falta de abastecimento de água na escola.

A Universidade Federal do Pará precisa ouvir, de forma individual, os diferentes cursos e, em especial, as diferentes unidades (Campi de interior) que fazem parte da mesma.  Embora existam muitas similaridades entre os principais problemas encontrados nas diferentes unidades, certamente estas necessidades são muito mais explícitas em unidades que encontram-se fora da sede principal da instituição (UFPA-Campus de Belém). Muitas vezes, as condições mínimas de trabalho para os profissionais da instituição (técnicos e docentes) estão muito aquém do que se espera de uma IFES considerada a mais importante do Norte do Brasil e uma das que mais cresceram e se desenvolveram em âmbito nacional na última década. Para ser menos subjetivo, pontuo abaixo algumas necessidades que vêm deixando de ser minimamente consideradas pela instituição e que deveras dificulta as atividades diárias dos funcionários da instituição, especialmente nos campi de interior:

- Infraestrutura deficitária (edifícios, salas, laboratórios, almoxarifados, etc.) e sem manutenção preventiva de telhados, paredes, sanitários, etc.);
Falta de um planejamento eficiente de aquisição e manutenção de condicionadores de ar em todos seus recintos (muitas salas, laboratórios, etc. sem condicionadores de ar, por exemplo);
- Falta de conhecimento, ou de um planejamento de desenvolvimento a curto, médio e longo prazo, dos itens infraestruturais cobrados pelo MEC quando da avalição de cursos de graduação (ausência de rampas e elevadores de acesso para pessoas com problemas de mobilidade na maioria de seus espaços (edifícios, bibliotecas, etc.), ausência de placas informativas sobre os edifícios de suas unidades para deficientes visuais; etc.);
- Internet de péssima qualidade nos "campi" de interior, aspecto este demandado pelos profissionais lotados nos mesmos em cada eleição para reitor e a cada gestão instituída nas últimas décadas. Aqui, cabe destacar que as avaliações do MEC estão ocorrendo de forma virtual (“presencial. In loco/virtual”) e que não se consegue manter o sistema em funcionamento nem mesmo durante as avaliações, havendo assim numerosas interrupções no momento das mesmas;
Ausência de um plano “claro e eficiente” de recomposição (aquisição) e manutenção preventiva efetiva e periódica dos veículos automotivos das unidades para o pleno funcionamento das atividades administrativas e, principalmente, para as atividades de campo com discentes e docentes dos diferentes campi;
Ausência de um plano de recomposição (aquisição) e manutenção preventiva efetiva e periódica dos "data shows" das unidades para o pleno funcionamento das atividades docentes dos diferentes campi;..., etc..
